import { ICurrentUser, IAction } from './userReducer';
import { UserActionTypes } from './userActionTypes';

export const setCurrentUser: (
  user: ICurrentUser | null
) => IAction<ICurrentUser | null> = (user: ICurrentUser | null) => ({
  type: UserActionTypes.SET_CURRENT_USER,
  payload: user,
});

export const googleSignInStart: () => IAction<any> = () => ({
  type: UserActionTypes.GOOGLE_SIGN_IN_START,
});

export const googleSignInSuccess: (
  user: ICurrentUser
) => IAction<ICurrentUser> = (user: ICurrentUser) => ({
  type: UserActionTypes.GOOGLE_SIGN_IN_SUCCESS,
  payload: user,
});

export const googleSignInFailure: (error: Error) => IAction<string> = (
  error: Error
) => ({
  type: UserActionTypes.GOOGLE_SIGN_IN_FAILURE,
  payload: error.message,
});

export const emailSignInStart: () => IAction<any> = () => ({
  type: UserActionTypes.EMAIL_SIGN_IN_START,
});

export const emailSignInSuccess: (
  user: ICurrentUser
) => IAction<ICurrentUser> = (user: ICurrentUser) => ({
  type: UserActionTypes.EMAIL_SIGN_IN_SUCCESS,
  payload: user,
});

export const emailSignInFailure: (error: Error) => IAction<string> = (
  error: Error
) => ({
  type: UserActionTypes.EMAIL_SIGN_IN_FAILURE,
  payload: error.message,
});
